import React from 'react';
import Container, { Grid, Typography,  } from '@mui/material'
import './css/MainPage.css';
function MainPage() {
    const tempData = [
        {
            id: 1,
            title: 'title1',
            content: 'data1'
        },
        {
            id: 2,
            title: 'title2',
            content: 'data2'
        },
        {
            id: 3,
            title: 'title3',
            content: 'data3'
        },
          {
            id: 4,
            title: 'title4',
            content: 'data4'
        },
    ];

  return (
    <>
    <Grid container spacing={2}>
        { tempData.map((item) => (
        <Grid item key={item.id}>
            <Typography>  Hello </Typography>
        </Grid>
        ))}
            </Grid>
    </>
  );
}

export default MainPage;
